import request from '@/utils/request'

const baseUrl = `/log/admin/dispatcher`

export default {
    listDispatcher() {   // 获取没有分配车辆的司机的id和name信息
        return request({
            url: `${baseUrl}/listDispatcher`,
            method: 'get'
        })
    }
}
